import { NavLink } from 'react-router-dom';
import s from './Dialogs.module.css'


const DialogItem = (props) => {
    return (
        <div className={`${s.dialog} ${s.active}`}>
            <NavLink to='/dialogs/1'>Alina</NavLink>
        </div>
    )
}


//Диалоги
const Dialogs = (props) => {
    return (
        <section className={s.dialogs}>
            <div className={s.dialogs_items}>

                {/* Список пользователей */}
                <div className={`${s.dialog} ${s.active}`}>
                    <NavLink to='/dialogs/1'>Alina</NavLink>
                </div>

                <div className={s.dialog}>
                    <NavLink to='/dialogs/2'>Vildan</NavLink>
                </div>

                <div className={s.dialog}>
                    <NavLink to='/dialogs/3'>Matvey</NavLink>
                </div>

                <div className={s.dialog}>
                    <NavLink to='/dialogs/4'>Isma</NavLink>
                </div>

                <div className={s.dialog}>
                    <NavLink to='/dialogs/5'>Vadik</NavLink>
                </div>

            </div>

            <div className={s.messages}>
                <div className={s.message}>Привет</div>
                <div className={s.message}>Как дела?</div>
                <div className={s.message}>Займи косарь</div>
            </div>
        </section>
    )
}

export default Dialogs;
